const moment = require('moment');

const romanNumerals = {
  'I': 1, 'IV': 4, 'V': 5, 'IX': 9,
  'X': 10, 'XL': 40, 'L': 50, 'XC': 90,
  'C': 100, 'CD': 400, 'D': 500, 'CM': 900,
  'M': 1000
};

const countries = ['indonesia', 'united states', 'france', 'germany', 'japan', 'brazil', 'australia', 'russia', 'canada', 'italy'];
const captchas = ['captcha1', 'captcha2', 'captcha3', 'captcha4', 'captcha5', 'captcha6', 'captcha7'];
let rulesChecker = Array(20).fill(0);

function romanToInt(s) {
  let sum = 0;
  for (let i = 0; i < s.length; i++) {
    if (i + 1 < s.length && romanNumerals[s[i] + s[i + 1]]) {
      sum += romanNumerals[s[i] + s[i + 1]];
      i++;
    } else {
      sum += romanNumerals[s[i]];
    }
  }
  return sum;
}

function isLeapYear(year) {
  return (year % 4 === 0 && year % 100 !== 0) || (year % 400 === 0);
}

function isPrime(n) {
  if (n <= 1) return false;
  if (n <= 3) return true;
  if (n % 2 === 0 || n % 3 === 0) return false;
  for (let i = 5; i * i <= n; i += 6) {
    if (n % i === 0 || n % (i + 2) === 0) return false;
  }
  return true;
}

function rule1(text) {
  return text.length > 5;
}

function rule2(text) {
  return /\d/.test(text);
}

function rule3(text) {
  return /[A-Z]/.test(text);
}

function rule4(text) {
  return /[^a-zA-Z0-9]/.test(text);
}

function rule5(text, X) {
  const matches = text.match(/\d/g);
  if (!matches) return false;
  const sum = matches.reduce((acc, digit) => acc + parseInt(digit, 10), 0);
  return sum === X;
}

function rule6(text) {
  return /(january|february|march|april|may|june|july|august|september|october|november|december)/i.test(text);
}

function rule7(text) {
  return /[IVXLCDM]+/i.test(text);
}


function rule8(text, countries) {
  return new RegExp(`(${countries.join('|')})`, 'i').test(text);
}

function rule9(text, X) {
  const matches = text.match(/\b[IVXLCDM]+\b/gi);
  if (!matches) return false;
  console.log('Total angka Romawi ditemukan:', matches.length);
  const isValid = matches.every(match => romanToInt(match) === 10);
  if (!isValid) return false;
  const total = matches.length * 10;
  return total === X;
}

function rule10(text, X) {
  setInterval(() => {
    const randomIndex = Math.floor(Math.random() * text.length);
    text = text.substring(0, randomIndex) + 'üî•' + text.substring(randomIndex + 1);
    console.log('Password setelah aturan 10:', text);
  }, X);
  return text;
}

function rule11(text, X) {
  setInterval(() => {
    if (!text.includes('ü•ö')) {
      console.log('Rule 11 failed: Emoji ü•ö is missing!');
      console.log('YOU LOSE!');
      process.exit(1);
    }
  }, X);
  return true;
}

function rule12(text, captcha) {
  return text.includes(captcha);
}

function rule13(text) {
  const matches = text.match(/\d{4}/g);
  if (!matches) return false;
  return matches.some(year => isLeapYear(parseInt(year, 10)));
}

function rule14(text, X, Y) {
  text = text.replace('ü•ö', 'üêî');
  setInterval(() => {
    const countWorms = (text.match(/üêõ/g) || []).length;
    if (countWorms < Y) {
      console.log('Rule 14 failed: Chicken üêî needs more worms üêõ!');
      process.exit(1);
    }
  }, X);
  return true;
}

function rule15(text, forbiddenLetters) {
  const pattern = new RegExp(`[${forbiddenLetters.join('')}]`, 'i');
  return !pattern.test(text);
}

function rule16(text) {
  return text.includes('I want IRK') || text.includes('I need IRK') || text.includes('I love IRK');
}

function rule17(text, X) {
  const numDigits = (text.match(/\d/g) || []).length;
  const totalChars = text.length;
  if (totalChars === 0) return false;
  const percentageDigits = (numDigits * 100) / totalChars;
  return percentageDigits >= X;
}

function rule18(text) {
  const lengthStr = text.length.toString();
  return text.includes(lengthStr);
}

function rule19(text) {
  return isPrime(text.length);
}

function containsCurrentTime(text, currentTime) {
  const currentTimeString = moment(currentTime).format('HH:mm');
  return text.includes(currentTimeString);
}

